import React from 'react';
import './Orders.css';
import {
  Container,
  Row,
  Col,
  Table,
  Spinner,
  Dropdown,
  DropdownButton,
  Button,
} from 'react-bootstrap';

export const Orders = (props) => {
  return (
    <Container className="orders-container">
      <Row className="column">
        <Col className="column">
          <i
            className="fas fa-times-circle icon"
            onClick={() => {
              props.updateClickedState();
            }}
          ></i>
          <Table striped hover>
            <thead>
              <tr className="table-row table-header">
                <th className="table-header">Name</th>
                <th className="table-header">Quantity</th>
                <th className="table-header">Lowest Price</th>
              </tr>
            </thead>
            <tbody>
              {this.state.assets
                ? this.state.assets.map(renderAsset)
                : renderBlank}
            </tbody>
          </Table>
        </Col>
        <Col className="column"></Col>
      </Row>
    </Container>
  );
};
